Veja o passo a passo para tirar a 2ª via da CNH:

1. Solicite este serviço pelo Assistente Virtual;

2. Pague a taxa em um banco conveniado;

3. Receba a via digital de seu documento até o dia seguinte do pagamento e a via impressa será enviada via Correios.

Veja o passo a passo para solicitar a sua CNH Definitiva:

1. Solicite este serviço pelo Assistente Virtual;
2. Pague a taxa em um banco conveniado;
3. Receba a via digital de seu documento até o dia seguinte do pagamento e a via impressa será enviada via Correios.
